import Main from './pages/Main'
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';

import WebFont from 'webfontloader';


function App() {
  useEffect(() => {
    WebFont.load({
        google: {
          families: ['Avenir']
        }
    });
  }, []);
  return (
    <div>
    <Routes>
      <Route exact path="/" element={<Main/>}/>
    </Routes>
    </div>
  );
}

export default App;
